export default function Home() {

    return (
        <div class= "main">
             <center>welcome hello react</center>
             <div>
              <Link to="/create"><Button>Sign up</Button></Link>
              <Link to="/login"><Button>Login in</Button></Link>
             </div>
        </div>
    )
}
